import React from 'react';
import MyButton from "../UI/button/MyButton";
import MyInput from "../UI/input/MyInput";
import classes from "./login.module.css"

const Login = () => {
    return (
        <div className={classes.cover}>
            <div className={classes.title}>Регистрация</div>
            <div className={classes.form}>
                <form>
                    <MyInput type="text" placeholder="Ваше имя"/>
                    <MyInput type="mail" placeholder="Эл. почта"/>
                    <MyInput type="password" placeholder="Пароль"/>

                    <MyInput type="checkbox" name="enabled" checked/>
                    <span>Я соглашаюсь с условиями использования и политикой конфиденциальности TypeTraining</span>

                    <MyInput type="checkbox" name="enabled" checked/>
                    <span>Получать новости о TypeTraining</span>


                    <MyButton>Зарегистрироваться</MyButton>
                </form>
            </div>

        </div>
);
};

export default Login;
